import React, { useEffect } from 'react';
import AOS from 'aos';
import 'aos/dist/aos.css'; // This imports the default AOS stylesheet
import { Container, Row } from 'react-bootstrap'; // Removed Col, Link as they are not used
import "../App.css";

export const Portfolio = () => {
    useEffect(() => {
        // Initialize AOS
        AOS.init({
          duration : 1000 // values from 0 to 3000, with step 50ms
        });
    }, []);

    return (
        <Row id="portfolio">
            <Container className="d-flex flex-column" id="projects">
                <div className="proj d-flex justify-content-center flex-column">
                    <div className="proj-title" data-aos="fade-up"><a href="https://github.com/marphco/pennywise" target="_blank" rel="noopener noreferrer">PENNYWISE</a></div>
                    <div className="proj-title" data-aos="fade-up">NOTEVERSE</div>
                    <div className="proj-title" data-aos="fade-up">ART HISTORY</div>
                    <div className="proj-title" data-aos="fade-up">NOTEVERSE</div>
                    <div className="proj-title" data-aos="fade-up">README BOT</div>
                    <div className="proj-title" data-aos="fade-up">FLEXI SOCIAL API</div>
                    <div className="proj-title" data-aos="fade-up">INFINI CART</div>
                    <div className="proj-title" data-aos="fade-up">EMPLOYEE SYNC</div>
                    <div className="proj-title" data-aos="fade-up">SCRIBELLA</div>
                    <div className="proj-title" data-aos="fade-up">SVG FORGE</div>
                    <div className="proj-title" data-aos="fade-up">SKY SWAY</div>
                </div>
            </Container>
        </Row>
    );
}

export default Portfolio;
